typedef void (*ppu_task_t)(ppu_t* ppu);

#define check_rendering if(!ppu_is_rendering(ppu)) return

static bool ppu_is_rendering(ppu_t* ppu){ return (ppu->mask & (1 << 3)) || (ppu->mask & (1 << 4)); }
static void ppu_task_idle(ppu_t* ppu) {}
static void ppu_task_read_nt(ppu_t* ppu) { check_rendering; ppu_read_nt(ppu); }
static void ppu_task_put_pix_shift(ppu_t* ppu) { ppu_put_pixel(ppu); ppu_shift(ppu); }
static void ppu_task_put_pix_shift_read_at(ppu_t* ppu) { ppu_put_pixel(ppu); ppu_shift(ppu); check_rendering; ppu_read_at(ppu); }
static void ppu_task_put_pix_shift_read_bg_lsb(ppu_t* ppu) { ppu_put_pixel(ppu); ppu_shift(ppu); check_rendering; ppu_read_bg_lsb(ppu); }
static void ppu_task_put_pix_shift_read_bg_msb(ppu_t* ppu) { ppu_put_pixel(ppu); ppu_shift(ppu); check_rendering; ppu_read_bg_msb(ppu); }
static void ppu_task_put_pix_shift_inc_hori(ppu_t* ppu) { ppu_put_pixel(ppu); ppu_shift(ppu); check_rendering; ppu_inc_hori(ppu); }
static void ppu_task_put_pix_shift_fill_shifter_read_nt(ppu_t* ppu) { ppu_put_pixel(ppu); ppu_shift(ppu); ppu_fill_shifter(ppu); check_rendering; ppu_read_nt(ppu); }
static void ppu_task_put_pix_shift_inc_hori_inc_vert(ppu_t* ppu) { ppu_put_pixel(ppu); ppu_shift(ppu); check_rendering; ppu_inc_hori(ppu); ppu_inc_vert(ppu); }
static void ppu_task_put_pix_shift_load_oam_fill_shifter_read_nt_reset_hori(ppu_t* ppu) { ppu_put_pixel(ppu); ppu_shift(ppu); ppu_fill_shifter(ppu); check_rendering; ppu_load_oam(ppu); ppu_read_nt(ppu); ppu_reset_hori(ppu); }
static void ppu_task_fill_shifter_read_nt(ppu_t* ppu) { ppu_fill_shifter(ppu); check_rendering; ppu_read_nt(ppu); }
static void ppu_task_fill_shifter_read_nt_reset_hori(ppu_t* ppu) { ppu_fill_shifter(ppu); check_rendering; ppu_read_nt(ppu); ppu_reset_hori(ppu); }
static void ppu_task_reset_vert(ppu_t* ppu) { check_rendering; ppu_reset_vert(ppu); }
static void ppu_task_fetch_sprite_hi(ppu_t* ppu) { check_rendering; ppu_fetch_sprite_hi(ppu); }
static void ppu_task_shift_fill_shifter_read_nt(ppu_t* ppu) { ppu_shift(ppu); ppu_fill_shifter(ppu); check_rendering; ppu_read_nt(ppu); }
static void ppu_task_shift(ppu_t* ppu) { ppu_shift(ppu); }
static void ppu_task_shift_read_at(ppu_t* ppu) { ppu_shift(ppu); check_rendering; ppu_read_at(ppu); }
static void ppu_task_shift_read_bg_lsb(ppu_t* ppu) { ppu_shift(ppu); check_rendering; ppu_read_bg_lsb(ppu); }
static void ppu_task_shift_read_bg_msb(ppu_t* ppu) { ppu_shift(ppu); check_rendering; ppu_read_bg_msb(ppu); }
static void ppu_task_shift_inc_hori(ppu_t* ppu) { ppu_shift(ppu); check_rendering; ppu_inc_hori(ppu); }
static void ppu_task_fill_shifter_read_nt_reset_vert(ppu_t* ppu) { ppu_fill_shifter(ppu); check_rendering; ppu_read_nt(ppu); ppu_reset_vert(ppu); }
static void ppu_task_read_nt_reset_vert(ppu_t* ppu) { check_rendering; ppu_read_nt(ppu); ppu_reset_vert(ppu); }
static void ppu_task_inc_hori_inc_vert(ppu_t* ppu) { check_rendering; ppu_inc_hori(ppu); ppu_inc_vert(ppu); }
static void ppu_task_inc_hori(ppu_t* ppu) { check_rendering; ppu_inc_hori(ppu); }
static void ppu_task_read_bg_msb(ppu_t* ppu) { check_rendering; ppu_read_bg_msb(ppu); }
static void ppu_task_fetch_sprite_lo(ppu_t* ppu) { check_rendering; ppu_fetch_sprite_lo(ppu); }
static void ppu_task_vblank_start(ppu_t* ppu) { ppu->status |= 0x80; if(ppu->ctrl & 0x80) ppu->nmi_pin = true; renderPixels(); }
static void ppu_task_vblank_end(ppu_t* ppu) { ppu->nmi_pin = false; ppu->hit_0_triggered = false; ppu->status &= 0x1F; }
static void ppu_task_read_at(ppu_t* ppu) { check_rendering; ppu_read_at(ppu); }
static void ppu_task_read_bg_lsb(ppu_t* ppu) { check_rendering; ppu_read_bg_lsb(ppu); }
static void ppu_task_end_of_frame(ppu_t* ppu) { ppu->end_of_frame = true; ppu->cycles = -1; }


